//TLE 42 / 76 个通过测试用例
var uniqueLetterString2 = function (s) {

    let calc = (word) => {

        let table = new Array(26).fill(0);
        for (let i = 0; i < word.length; i++) {
            table[word.charCodeAt(i) - 'A'.charCodeAt(0)]++;
        }
        let len = 0;
        for (let i = 0; i < table.length; i++) {
            if (table[i] == 1) {
                len++;
            }
        }
        //console.log(`${word} ${len}`);
        return len;
    }

    let n = s.length;
    let sum = 0;
    for (let i = 0; i < n; i++) {
        for (let j = 1; i + j <= n; j++) {
            sum += calc(s.slice(i, i + j));
        }
    }
    return sum;
};

