var uniqueLetterString3 = function (s) {
    let n = s.length;
    let sum = 0;
    for (let i = 0; i < n; i++) {
        let table = new Array(26).fill(0);
        let len = 0;
        for (let j = 0; i + j < n; j++) {
            let index = s.charCodeAt(i + j) - 65;
            if (table[index] == 0) {
                len++;
            } else if (table[index] == 1) {
                len--;
            }
            table[index]++;

            sum += len;
        }
    }
    return sum;
}

