//TLE PASS 滑动窗口，动态规划，找出第一个和第二个字符串

var uniqueLetterString = function (s) {
    let n = s.length;
    let sum = 0;
    let left = 0, right = 0;
    let table = new Array(26).fill(0);
    let tablePos = new Array(26).fill(0).map(() => []);
    let lastLineSum = 0;
    let len = 0;
    while (left < n) {
        //console.log(`right ${right}`);
        if (right < n) {
            let index = s.charCodeAt(right) - 65;
            if (table[index] == 0) {
                len++;
            } else if (table[index] == 1) {
                len--;
            }
            tablePos[index].push(right);
            table[index]++;
            sum += len;
            right++;
            lastLineSum += len;
        }

        //如果满了，后面的不能满足条件，left前进
        let kind = 0;
        for (let k = 0; k < table.length; k++) {
            if (table[k] > 1) {
                kind++;
            }
        }

        if (kind == table.length || right == n) {
            let nextLeft = left;
            //console.log(`${lastLineSum}`);
            while (nextLeft < n) {
                let index = s.charCodeAt(nextLeft) - 65;
                let first = -1;
                let second = -1;
                tablePos[index].shift();
                first = tablePos[index][0];
                second = tablePos[index][1];
                if(first == null) {
                    lastLineSum = lastLineSum - (right - nextLeft);
                } else if(second == null) {
                    lastLineSum = lastLineSum - (first - nextLeft) + (right - first);
                } else {
                    lastLineSum = lastLineSum - (first - nextLeft) + (second - first);
                }
                //console.log(`${lastLineSum}`);
                sum += lastLineSum;
                table[index]--;
                if (table[index] == 1 && right != n) {
                    len++;
                    nextLeft++;
                    break;
                } else {
                    nextLeft++;
                }          
            }
            left = nextLeft;
        }
        // console.log(`${dp.join('\n')}`);
        // console.log(`kind ${kind} sum ${sum}`);

    }
    //console.log(`count ${count}`);
    return sum;
}

